function main(){submit(JSON.stringify(question))}function type(t,e){$("input[name="+t+"]").val(e)}function typeMQ(t){let e=MathQuill.MathField($("#expression-answer")[0]);e.write(t)}function typeCoords(t){MathQuill=MathQuill.getInterface(1);let e=MathQuill.MathField($(".expression-answer-x mq-editable-field mq-math-mode")[0]);e.write(t)}function cleanJSON(t){let e="";for(i=0;i<t.length;++i)'"'==t.at(i)?e+='"':e+=t.at(i);return e}function submit(t){$.ajax({type:"POST",url:"https://dfm-answers.herokuapp.com/api/world",contentType:"application/json",processData:!1,cache:!1,data:JSON.stringify({qJSON:cleanJSON(t)}),success:function(t){if(t=JSON.parse(t),console.log(t),0==t.typeCount)alert(t.alertString);else for(MathQuill=MathQuill.getInterface(1),i=0;i<t.typeCount;++i)type(t.toType[i].nameVal,t.toType[i].text)},error:function(t,e,i){alert("error:"+e+" "+i)}})}main();